  `score3` int DEFAULT '-1' COMMENT '第三道题的成绩',
  `question4` varchar(255) DEFAULT '-1' COMMENT '问题4',
  `score4` int DEFAULT '-1' COMMENT '第四道题的成绩',
  `question5` varchar(255) DEFAULT '-1' COMMENT '问题5',
  `score5` int DEFAULT '-1' COMMENT '第五道题的成绩',
  `question6` varchar(255) DEFAULT '-1' COMMENT '问题6',
