  `tests` int DEFAULT '-1' COMMENT '过题数',
  `total_score` int DEFAULT '0' COMMENT '总成绩',
  PRIMARY KEY (`studentid`),
  UNIQUE KEY `c方向答题_pk_2` (`studentid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='c方向的答题和成绩';
